webpackJsonp([0x6f01df4dde89],{4900:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Internet Operator",date:"19 Mar 2007",slug:"/2007-03-19-internet-operator/",tags:"Y2007"},html:'<p><a href="http://en.wikipedia.org/wiki/Michael_Glos">Michael Glos</a> is Germany\'s Economics and Technology Minister. He doesn\'t really understand the internet, but then <a href="http://blog.handelsblatt.de/indiskretion/eintrag.php?id=1167">he doesn\'t need to</a>:</p>\n<blockquote><p>\n  Thankfully I have people who operate the internet for me<br />\n  <em>(Ich habe Gott sei Dank Leute, die f√ºr mich das Internet bedienen)</em>\n</p></blockquote>\n<p>I guess that means his secretary prints out his email for him.</p>\n<p>He actually spends most of his time protecting Germany\'s car industry. He doubt that he understands cars either, but he has people who operate them for him. (via <a href="http://www.ringfahndung.de/archives/reine_machtkritik/michael_glos_vorzimmerdame_20_susser_referent_20.html">Ringfahndung</a>)</p>'},next:{fields:{title:"Dante's CeBIT",date:"19 Mar 2007",slug:"/2007-03-19-dantes-cebit/"}},previous:{fields:{title:"Samsung Q35 Red",date:"19 Mar 2007",slug:"/2007-03-19-samsung-q35-red/"}}},{node:{fields:{title:"Dante's CeBIT",date:"19 Mar 2007",slug:"/2007-03-19-dantes-cebit/",tags:"Y2007"},html:"<p>I'm proud to say that for the 9th consecutive year, I will not be attending the CeBIT in Hannover, and that if you want to meet me, I won't be there.</p>\n<p>Back before I worked I worked in IT, I used to go every year. These days I have no interest. I think that if Dante were alive today, he'd write about the circles of CeBIT insteal of the <a href=\"http://en.wikipedia.org/wiki/Dante%27s_Inferno#The_Circles_of_Hell\">circles of Hell</a>.</p>"},next:{fields:{title:"CrossTouran",date:"18 Mar 2007",slug:"/2007-03-18-crosstouran/"}},previous:{fields:{title:"Internet Operator",date:"19 Mar 2007",slug:"/2007-03-19-internet-operator/"}}},{node:{fields:{title:"CrossTouran",date:"18 Mar 2007",slug:"/2007-03-18-crosstouran/",tags:"Y2007"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/03/crosstouran1.jpg" alt="Crosstouran" /></p>\n<p>We\'re looking at new cars. Something roomy and practical but not too plain. The new <a href="http://www.volkswagen.de/vwcms_publish/vwcms/master_public/virtualmaster/de3/modelle/touran/ausstattungsvarianten/CrossTouran.html">CrossTouran</a> from Volkswagen has caught our eye. It\'s kind of a cross between a SUV and a van, but the TDI still gets 6.2 l per 100 km (that\'s <a href="http://www.google.com/search?q=6.2+l+per+100+km+in+mpg">38 mpg</a>). The deep black with anthracite interior looks sharp. But you <a href="http://jalopnik.com/cars/news/more-rides-yanks-cant-buy-volkswagens-twincharged-crosstouran-219228.php">can\'t get it in the States</a>.</p>'},next:{fields:{title:"Travel Insurance",date:"17 Mar 2007",slug:"/2007-03-17-travel-insurance/"}},previous:{fields:{title:"Dante's CeBIT",date:"19 Mar 2007",slug:"/2007-03-19-dantes-cebit/"}}}],pathPrefix:"",first:!1,last:!1,index:147,pageCount:1101}}}});
